import { v4 as uuidv4 } from 'uuid';

export const initialNames = [
    {
        id: uuidv4(),
        text: "Monroe Vire"
    },
    {
        id: uuidv4(),
        text: "Delphine Atkins"
    },
    {
        id: uuidv4(),
        text: "Suzann Mcgarity"
    },
    {
        id: uuidv4(),
        text: "Jackie Dicus"
    },
    {
        id: uuidv4(),
        text: "Buck Brungardt"
    }
];
